import styled from "styled-components";
import MainSecLeft from "./MainSecLeft";
import MainSecRight from "./MainSecRight"

const SectionCTA = styled.section`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
`

function Section02(){
    return (
        <SectionCTA>
            <MainSecLeft />
            <MainSecRight />
        </SectionCTA>
    )
}

export default Section02
